from typing import List
from collections import deque

class Solution:
    def updateMatrix(self, mat: List[List[int]]) -> List[List[int]]:
        rows = len(mat)
        cols = len(mat[0])
        # We shall update the matrix itself
        dq = deque()
        seen = set()
        # Fill in the starter cells first
        for r in range(rows):
            for c in range(cols):
                if mat[r][c] == 0:
                    dq.append((r, c))
                    seen.add((r, c))
        #print(f'\tdq = {dq}')
        directions = [[0,1],[1,0],[0,-1],[-1,0]]
        distance = 1
        # BFS from the starter cells until the entire matrix is covered
        while dq:
            #print(f'\t\tdq ; mat = {dq} ; {mat}')
            size = len(dq)
            for _ in range(size):
                cur = dq[0]
                for dr, dc in directions:
                    rnew = cur[0] + dr
                    cnew = cur[1] + dc
                    if 0 <= rnew < rows and 0 <= cnew < cols:
                        #print(f'\t\trnew, cnew = {rnew}, {cnew}')
                        if mat[rnew][cnew] == 1 and (rnew, cnew) not in seen:
                            mat[rnew][cnew] = distance
                            seen.add((rnew, cnew))
                            dq.append((rnew, cnew))
                dq.popleft()
            distance += 1
        return mat

